    false,nt"url": null,nt"notes": "This data set consists of six-inch pixel
    resolution, natural color orthoimages covering the urban area footprint. An orthoimage
    is remotely sensed image data in which displacement of features in the image caused
    by terrain relief and sensor orientation have been mathematically removed. Orthoimagery
    combines the image characteristics of a photograph with the geometric qualities
    of a map. Each orthoimage provides imagery over a 5000-foot by 5000-foot block on
    the ground. There is no image overlap between adjacent files. The projected coordinate
    system is Georgia State Plane West (FIPS 1002) feet with a NAD83 datum.",nt"license_title":
